import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for a visible "Electronics" category card (using category-card class and text)
    const electronicsCard = await page.waitForSelector(
      "//div[contains(@class, 'category-card')][contains(., 'Electronics')]",
      { timeout: 5000 }
    );

    // Take screenshot before clicking
    const step2 = path.join(screenshotsDir, 'step_2_electronics_card_visible.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for a heading or section indicating Electronics category is active
    // Try to find an h2 or div with text "Electronics" (category header)
    await page.waitForSelector(
      "//h2[contains(text(), 'Electronics')] | //div[contains(@class, 'category-results')]//h2[contains(text(), 'Electronics')]",
      { timeout: 5000 }
    );

    // Take screenshot after navigation
    const step3 = path.join(screenshotsDir, 'step_3_electronics_category.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract product titles from the Electronics category grid (first 5)
    const productTitles = await page.$$eval(
      ".products-grid .product-card .product-title",
      nodes => nodes.slice(0, 5).map(n => n.textContent.trim())
    );

    return {
      success: true,
      action: "Navigated to Electronics category via category card and verified product listing.",
      extractedData: {
        electronicsProductTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
